import React from 'react';

import { faTwitterSquare, faFacebookF, faInstagram } from '@fortawesome/free-brands-svg-icons'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const Footer = () =>{
  return(
    <div className='container bg-light text-center py-4'>
      <h3>Follow Us!</h3>
      <div className='row w-50'>
        <div className='col'><FontAwesomeIcon icon={faTwitterSquare}/></div>
        <div className='col'><FontAwesomeIcon icon={faFacebookF}/></div>
        <div className='col'><FontAwesomeIcon icon={faInstagram}/></div>
      </div>
    </div>
  )
}

export default Footer
